import React from 'react';

const Message = () => {
  return (
    <>
      <div>
        <div>
          <h1>Welcome to the Message page</h1>
          <h1>If you send more than three messages without a reply</h1>
          <h1>Youre a weirdo</h1>
        </div>

      </div>

    </>
  );
};

export default Message;
